  false,\n\t\"url\": null,\n\t\"notes\": \"This part of DS 781 presents data for the
  bathymetry and shaded-relief maps of Offshore Santa Cruz, California. The raster
  data file is included in \"BathymetryHS_OffshoreSantaCruz.zip\", which is accessible
  from http://dx.doi.org/10.5066/F7TM785G. The bathymetry and shaded-relief maps of
  Offshore Santa Cruz, California, were generated from bathymetry data collected by
  the U.S. Geological Survey (USGS). Mapping was completed in 2009 using a 234-kHz
  SWATHplus bathymetric sidescan-sonar system. The mapping mission collected bathymetry
  data from about the 10-m isobath to beyond the 3-nautical-mile limit of Californiau0092s
  State Waters. NOTE: The horizontal datum of this bathymetry data (NAD83) differs
  from the horizontal datum of other layers in this data release (WGS84).\",\n\t\"owner_org\":
